<?php//IMPLEMENTAR...require_once 'clases/Usuario.php';	$usuarios=json_decode(json_encode($_POST["userpass"]));$user=Usuario::TraerUsuarioLogueado($usuarios);$resultado=new stdClass();$resultado->Logueado = FALSE;	if ($user!=NULL) {				$unUser = new stdClass();			$unUser->id=$user["id"];		$unUser->nombre=$user["nombre"];		$unUser->correo=$user["email"];		$unUser->foto=$user["foto"];		session_start();		$_SESSION["UserLog"] = $unUser;				$resultado->Logueado = TRUE;		$resultado->idUser = $unUser->id;	}		echo json_encode($resultado);?>